const client = new ApolloClient({
  uri:"http://localhost:4000/graphql"
})





function App() {
  return (
    <ApolloProvider client={client}>
      <div className="App">
        <Routes></Routes>
        <Route path="/" element={<Login/>}></Route>
        <Route path="/" element={<Login/>}></Route>
        

      </div>
    </ApolloProvider>
  );
}

export default App;
